  render() {
    return (
      <container>
      <div className="container">
        <h3>Physician Information</h3>
        <div className="row">
            <div className="column">
                <DoctorName/>
            </div>
            <div className="column">
                <DoctorEmail/>
            </div>
            <div className="column">
                <DoctorEmail/>
            </div>
          </div>
    </div>
    </container>

    );
  }
}

export default DoctorDetails;
